import Icon from '@ant-design/icons'
import { DIALECT } from './service'

const svgSize = '20px'

export const getIcon = (type: string) => {
  switch (type) {
    case DIALECT.KAFKA:
      return <Icon component={KafkaSvg} />
    case DIALECT.FTP:
      return <Icon component={FtpSvg} />
    case DIALECT.FILE:
      return <Icon component={FileSvg} />
    case DIALECT.FLINKSQL:
      return <Icon component={FlinkSQLSvg} />
    case DIALECT.HIVE:
      return <Icon component={HiveSvg} />
    case DIALECT.SPARK:
      return <Icon component={SparkSvg} />
    case DIALECT.FLINK:
      return <Icon component={FlinkSvg} />
    case DIALECT.SQL:
      return <Icon component={SQLSvg} />
    case DIALECT.QUALITY:
      return <Icon component={QualitySvg} />
    case DIALECT.Console:
      return <Icon component={ConsoleSvg} />
    case DIALECT.HDFS:
      return <Icon component={HdfsSvg} />
    case DIALECT.Mysql:
      return <Icon component={MysqlSvg} />
    case DIALECT.Filter:
      return <Icon component={FilterSvg} />
    default:
      return <Icon component={FlinkSQLSvg} />
  }
}
